import React from "react";
import HomePage from "../HomePage/HomePage";
import Game1 from "../GameSelection/Game1/Game1";
import Game2 from "../GameSelection/Game2/Game2";
import Game3 from "../GameSelection/Game3/Game3";
import Game4 from "../GameSelection/Game4/Game4";
import LeaderBoard from "/home/marv/the-odin-project/react-projects/anime-search/src/Leaderboard/LeaderBoard.js";

const RouteSwitch = () => {
    return (
      <BrowserRouter>
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/game1" element={<Game1/>} />
            <Route path="/game2" element={<Game2/>} />
            <Route path="/game3" element={<Game3/>} />
            <Route path="/game4" element={<Game4/>} />
            <Route path="/leaderboard" element={<LeaderBoard/>} />
          </Routes>
      </BrowserRouter>
    );
  };

  export default RouteSwitch;
